import React from "react";
import {Form, Formik } from 'formik';
import { Link } from "react-router-dom";

import "./username.scss";

export default function Username(props) {
    return (
        <div className='signin'>
            <div className="container">
                <div className="mainTitle">Sign in</div>

                <div className="labelText">Username</div>

                <Formik
                initialValues={{
                    username: ''
                }}

                validationSchema={AccountSchema}

                onSubmit={(values, actions) => {
                    setTimeout(() => {
                        alert(JSON.stringify(values, null, 2));
                        actions.setSubmitting(false);
                    }, 1000);
                }}
            >
                {(props) => (
                    <Form>
                        <div className="firstnameWrapper">
                            <MyTextField name="firstName" type="text" label="First Name" />
                        </div>
                        <div className='lastnameWrapper'>
                            <MyTextField name="lastName" type="text" label="Last Name" />
                        </div>
                        <MyTextField name="username" type="text" label="Username" />
                        <MyTextField name="retypeUsername" type="text" label="Re-type username" />
                        <MyTextField name="password" type="text" label="Password" />
                        <MyTextField name="retypePassword" type="text" label="Re-type password" />
                        <button type="submit">Submit</button>
                    </Form>
                )}
            </Formik>

                <input type="text" required />

                <button type="submit" onClick={() => props.verifyUsername()}>Next</button>
            </div>
            <div className="centerText commonLabels">
                New to Autodesk ?  <Link to="/">Create account</Link>
            </div>

            <div className="footer commonLabels">
                <p>Your account for everything Autodesk</p>
                <a href={''} >Learn More</a>
            </div>
        </div>
    );
}
